public boolean equals(Object o) {
  if (this == o) {
    return true;
  }
  if (o == null || getClass() != o.getClass()) {
    return false;
  }
  UserCommandKey that = (UserCommandKey) o;
  return getUser().equals(that.getUser()) &&
      getCommand().equals(that.getCommand()) &&
      getType().equals(that.getType());
}
